import React from 'react'

function Contact() {
  return (
    <div>
        <p>Get In Touch</p>
        <p>Say hi or something...
        email & comment - submit
        Social Media : Github, Linkedin, Instagram, Medium</p>
    </div>
  )
}

export default Contact
